      gender: DataTypes.BOOLEAN,
      introduce: DataTypes.STRING,
      avatar: DataTypes.STRING,
      backgroundPhoto: DataTypes.STRING,
    },
    {
      sequelize,
      modelName: "users",
    }
  );
  return Users;
};

